import AuthService from './AuthService/AuthService';
import EmployeesService from './EmployeesService/EmployeesService';
import EmployeeRolesService from './EmployeesService/EmployeesRolesService';
import LanguageService from './LanguagesService/LanguagesService';
import ProjectsService from './ProjectsService/ProjectsService';
import ProjectsStatusesService from './ProjectsService/ProjectsStatusesService';
import ProjectDeliveryTypesService from './ProjectsService/ProjectDeliveryTypesService';
import UsersService from './UsersService/UserService';
import SLAsService from './SLAsService/SLAsService';

export default class Services {
   static AuthService = AuthService;
   static EmployeesService = EmployeesService;
   static EmployeeRolesService = EmployeeRolesService;
   static LanguageService = LanguageService;
   static ProjectsService = ProjectsService;
   static ProjectsStatusesService = ProjectsStatusesService;
   static ProjectDeliveryTypesService = ProjectDeliveryTypesService;
   static SLAsService = SLAsService;
   static UsersService = UsersService;
}
